descargarInforme(letra: String){
  var imagen = 'data:image/png;base64,';

  var datos = 'data:image/png;base64,';
  var source = document.getElementById('contentInforme').innerHTML;
  var margins = {
    top: 25,
    bottom: 10,
    left: 10,
    width: 595
  };

  const doc = new jsPDF("landscape");
  doc.text(220, 15, 'WARMI - WEB');
  doc.setTextColor(150);
  doc.setFontSize(10);
  doc.text(200, 20, 'Parte administrativa de la app movil Warmi');
  doc.setDrawColor(150);
  doc.setLineWidth(0.5);
  doc.line(10, 25, 290, 25);
  doc.setTextColor(20);
  doc.text(100, 280, '1');
  doc.setFont("arial")

  if(letra === "imagen"){
    doc.text(25, 30, 'Gráfica a partir del número de denuncias por año y en base a los tipos de denuncias:');
    doc.addImage(imagen, 'JPEG', 25, 35, 250, 120);
  } else {
    if(letra === "datos"){
    doc.text(15, 30, 'Tabla a partir del número de denuncias por año y en base a los tios de denuncias:');
    doc.addImage(datos, 'JPEG', 15,35, 270, 120);
  } else {
      doc.text(25, 30, 'Gráfica a partir del número de denuncias por año y en base a los tipos de denuncias:');
      doc.addImage(imagen, 'JPEG', 60, 35, 190, 76);
      doc.text(25, 115, 'Tabla a partir del número de denuncias por año y en base a los tipos de denuncias:');
      doc.addImage(datos, 'JPEG', 45, 120, 220, 76);
  }}
  doc.save('Informe de ' + Date() + '.pdf'); 
}

descargarGrafica(){

  var source = document.getElementById('contentGrafica').innerHTML;
  var margins = {
    top: 25,
    bottom: 10,
    left: 10,
    width: 595
  };

  const doc = new jsPDF();
  doc.text(160, 15, 'WARMI - WEB');
  doc.setTextColor(150);
  doc.setFontSize(10);
  doc.text(130, 20, 'Parte administrativa de la app movil Warmi');
  doc.setDrawColor(150);
  doc.setLineWidth(0.5);
  doc.line(10, 25, 200, 25);
  doc.setTextColor(20);
  doc.text(100, 280, '1');
  doc.setFont("arial")
  doc.fromHTML(
    source, // HTML string or DOM elem ref.'
    0,
    margins.top, {
      'width': margins.width,
      'elementHandlers': this.specialElementHandlers
    },
    
    function(dispose) {
      doc.save('Grafica de ' + Date() + '.pdf');
    }, margins);      
}

